import Product from "./Product";

const ProductList = (props) => {
  return (
  <ul>
        {props.products.map((product) => (
          <Product
            key={product.id}
            id={product.id}
            image={product.image}
            title={product.title}
            price={product.price}
            text={product.text}
          />
        ))}
   </ul>
  );
};

export default ProductList;
